<?php
$data = "";
$data = base64_decode($data);
$key = base64_decode('Tk9SRmhzYUNXWkpvamJtdg=='); // key ending should have 2 elements of null bytes due to == (from js code??)

$tmpindex = 0;
$out = '';
for ($i=0; $i<strlen($data); $i++){
	$cur = ord($data[$i]);
	$cur ^= ord($key[$tmpindex]);
	$out .= chr($cur);
}

echo $out;
?>